"use strict";

import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

var test = "Hello, World";


class App extends React.Component {
   render() {
      return (
         <div>
            <h1>{test}</h1>
         </div>
      );
   }
}


export default App;

window.onload = function() {
	ReactDOM.render(<App />, document.getElementById('root'));
}
